snippet.description:
Empieza la nueva serie de Los Vecinos (Acenix, Mikecrack, Invictor, Timba y Mondongo). Una serie survival de Minecraft donde habrá bromas, trolleos y mucho más. Y en este episodio 1 haré una casa segura para protegerme de todos ellos.
🛒 Tienda Oficial: https://acenix.cat/

